import React from 'react'

function ToggleArrow({isOpen}) {
  return (<span style={{position: "relative"}}><div style={{position: "absolute", color: "gray", fontSize: "0.5rem", padding: "3px", transform: "rotate(90deg)"}}>{isOpen ? "<": ">"}</div></span>
  )
}

export default ToggleArrow
